function Cart(props) {
  return (
    <div>
      
              <td>{props.title}</td>
              <td>{props.cost}</td>
              <td>{props.quantity}</td>
              <td>{props.cost}</td>
              <td>{props.quantity}</td>
      
    </div>
  )
}
export default Cart;
